import { Box, Typography } from "@mui/material";
import colors from "../utils/colors";
import QualityIcon from "../widgets/QualityIcon";
import BoltOutlinedIcon from '@mui/icons-material/BoltOutlined';

const Qualities = ({mediaQuery, t}) => {

    return(
        <Box
            width="100%"
            display="flex"
            backgroundColor="lightblue"
            margin="1rem"
            sx={{padding: (mediaQuery ? '1.5rem' : '1rem')}}
            border="1px solid black"
            justifyContent="center"
        >
            <Box
                width="90%"
                backgroundColor="lightgreen"
                padding="1rem"
                border="1px solid black"
                display="flex"
                justifyContent="space-around"
                alignItems="center"
                sx={{flexDirection: (mediaQuery ? 'row' : 'column-reverse')}}
            >
                <QualityIcon quality={t('fastDelivery')} ico={<BoltOutlinedIcon sx={{fontSize: "50px"}}></BoltOutlinedIcon>}></QualityIcon>
            </Box>
        </Box>
    )
}

export default Qualities;
